#include <iostream>#include <algorithm>#include <vector>#include <queue>#include <string>#include <cstdio>using namespace std;int main() {	string str;	int n;	cin >> n;	int arr[27] = { 0, };	for (int i = 0; i < n; i++) {		cin >> str;		arr[str[0] - 'a']++;	}	vector<char> vec;	for (int i = 0; i < 27; i++) {		if (arr[i] >= 5) vec.push_back(i + 'a');	}	if (vec.size() == 0) {		cout << "PREDAJA";	}	else {		for (int i = 0; i < vec.size(); i++) {			cout<<vec[i];		}	}}